import { useState, useEffect } from "react";
import Blogs from "./components/Blogs";

const App = () => {
  const [blogs, setBlogs] = useState([{
    blog: {
      title: "test",
      author: "test",
      url: "test",
      likes: "1"
    }
  }])

  return (
    <div className="App">
      <h1>Blogs</h1>
      {blogs}
      <Blogs blogs={blogs} />
    </div>
  );
}

export default App
